import Header from "./components/Header";
import Subheader from "./components/Subheader";
import Newsletter from "./components/Newsletter";
import Footer from "./components/Footer";

const App = () => {
  return (
    <div className="">
      <Header />
      <Subheader />
      <Newsletter />
      <Footer />
    </div>
  );
};

export default App;
